import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './components/navegacion/Navbar';
import Inicio from './components/paginas/Inicio';
import Invernadero1 from './components/paginas/Invernadero1';
import Invernadero2 from './components/paginas/Invernadero2';
import Invernadero3 from './components/paginas/Invernadero3';
import Consultas from './components/paginas/Consultas';
import './App.css'; // Archivo CSS para estilos personalizados

function App() {
  // Ejemplo de valores importados de MongoDB Atlas
  const temperatura = 25;
  const humedad = 70;
  const co2 = 500;

  return (
    <div className="App">
      <Router>
        <Navbar />
        <div className="content">
          <Routes>
            <Route path="/" element={<Inicio />} />
            <Route path="/Invernadero1" element={<Invernadero1 />} />
            <Route path="/Invernadero2" element={<Invernadero2 />} />
            <Route path="/Invernadero3" element={<Invernadero3 />} />
            <Route path="/Consultas" element={<Consultas />} />
          </Routes>
        </div>
        <div className="footer">
          <div className="temperature-section">
            <h3 className="center">Temperatura</h3>
            <p className="center">{temperatura} °C</p>
          </div>
          <div className="humidity-section">
            <h3 className="center">Humedad</h3>
            <p className="center">{humedad}%</p>
          </div>
          <div className="co2-section">
            <h3 className="center">CO2</h3>
            <p className="center">{co2} ppm</p>
          </div>
          <div className="footer-image">
            {/* Contenido de la imagen de pie de página */}
          </div>
        </div>
      </Router>
    </div>
  );
}

export default App;
